pragma solidity ^0.8.0;

// SPDX-License-Identifier: BUSL-1.1

import "./Interfaces/Interfaces.sol";
import "./PriceProvider.sol";

contract TwapPriceProvider {
    address public token0;
    address public token1;
    ISlidingWindowOracleV1 public twap;
    AggregatorV3Interface public priceProvider;

    constructor(
        address _token0,
        address _token1,
        ISlidingWindowOracleV1 _twap,
        AggregatorV3Interface pp
    ) {
        token0 = _token0;
        token1 = _token1;
        priceProvider = pp;
        twap = _twap;
    }

    function isRoundIdValid(uint256 roundId, uint256 timestamp)
        external
        view
        returns (bool)
    {
        (uint256 roundTimestamp, ) = getRoundData(roundId);
        if ((timestamp < roundTimestamp)) {
            return false;
        } else if (timestamp - roundTimestamp > twap.periodSize()) {
            return false;
        }
        return true;
    }

    function getRoundData(uint256 roundId)
        public
        view
        returns (uint256 roundTimestamp, uint256 price)
    {
        (roundTimestamp, price) = twap.getTimeWeightedAverage(
            token0,
            token1,
            roundId
        );
        price = toUsd(price);
    }

    function decimals() external view returns (uint256) {
        return priceProvider.decimals();
    }

    function toUsd(uint256 token_price) public view returns (uint256 price) {
        (, int256 latestPrice, , , ) = priceProvider.latestRoundData();
        uint256 bnb_price = uint256(latestPrice);
        price = (token_price * bnb_price) / twap.factor();
    }

    // Should return USD price
    function getUsdPrice() external view returns (uint256 price) {
        uint256 token_price = twap.consult(token0, token1);
        price = toUsd(token_price);
    }
}

contract FakeTwapPriceProvider {
    address public token0;
    address public token1;
    FakePriceProvider public priceProvider;
    uint256 public price;
    mapping(uint256 => uint256) public roundIDToExpiry;
    mapping(uint256 => uint256) public roundIDToPrice;

    constructor(
        address _token0,
        address _token1,
        FakePriceProvider pp
    ) {
        token0 = _token0;
        token1 = _token1;
        priceProvider = pp;
    }

    function setPrice(uint256 _price) external {
        price = _price;
    }

    function getRoundData(uint256 roundID)
        external
        view
        returns (
            uint80 roundId,
            uint256 _price,
            uint256 startedAt,
            uint256 updatedAt,
            uint80 answeredInRound
        )
    {
        (roundId, _price, startedAt, updatedAt, answeredInRound) = (
            uint80(roundID),
            roundIDToPrice[roundID],
            0,
            roundIDToExpiry[roundID],
            0
        );
    }

    function setRoundData(
        uint256 roundID,
        uint256 expiry,
        uint256 _price
    ) external {
        roundIDToExpiry[roundID] = expiry;
        roundIDToPrice[roundID] = _price;
    }

    // Should return USD price
    function getUsdPrice() external view returns (uint256 _price) {
        uint256 bnb_price = priceProvider.getUsdPrice();
        uint256 token_price = price;
        _price = (token_price * bnb_price) / 1e8;
    }
}
